void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    vec2 uv = (fragCoord-.5*iResolution.xy)/iResolution.y;

    uv.y += sin(uv.x*3.14*5.+iTime)*.1;
    uv.x += sin(uv.y*3.14*5.+iTime)*.1;

    float t = sin(iTime)/2.+.5;
    float d = length(uv)*13.;
    d= fract( mod(d,uv.x*uv.y*iTime) );
    d = step(t,d);

    fragColor = vec4(d);
}
